import React from 'react'

class Card extends React.Component {

    constructor(props) {
        super(props)
        this.plan = this.props.plan
        this.select = this.select.bind(this)
        this.state = {
            border: null
        }
    }

    select = (name, plan) => {
        this.props.select(name, plan)
        if (this.state.border) {
            this.state.border = null
        } else {
            this.state.border = "border border-success rounded"
        }
    }

    render() {
        return (
               <div class="col-sm">
               <div className={this.state.border}>
                    <div class="card">
                    <div class="card-body">
                        <h5 class="card-title">{this.plan.name}</h5>
                        <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
                        <a href="#" class="btn btn-primary" onClick={this.select(this.plan.name, this.plan)}>Go somewhere</a>
                    </div>
                    </div>
                    </div>
                </div>
        )
    }
}

export default Card
